import React from 'react';
import "./bodycart.css"

const bodycart = () => {
  return (
    <div>
                <header className="App-header">
        <ul style={{listStyle:"none"}}>
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </header>
    </div>
  )
}

export default bodycart
